import React from 'react';

function ProductList() {
  // 하드코딩된 상품 목록 데이터
  const products = [
    { id: 1, name: 'Revuelto', price: "700,000", imageUrl: 'my-app\public\carimg\H4sIAAAAAAAA_y2Vy8oltxHHj2dwbAKxSUIIfoEhYEj1_bL4CDbeJYtAQhaZxVDq1u1IfTmSuvs7_Ux-nyy8yQNMVtlkE8i_h4CoH1VdJZWqJPWP_7p9voXb2_fvv__jf7_5jdY_tW9ut9f1drt9Bvub99__-O_f_udnX_71n_83f_GP2-dpC2L5DC5_f_NzO7GWdF-l_sXHjx-_vn0B (1).jpg' },
    { id: 2, name: 'Urus', price: "300,000" },
    { id: 3, name: 'k5 DLS', price: "30,000" },
  ];

  return (
    <div>
      <h2>상품 목록</h2>
      <ul>
        {products.map(product => (
          <li key={product.id}>
            <strong>{product.name}</strong>: {product.price}$
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ProductList;
